package com.example.file;

import org.apache.commons.io.FileUtils;

import java.io.*;
import java.util.Base64;

public class Base64Test2 {
    public static void main(String[] args) throws IOException {

        byte[] fileContent = FileUtils.readFileToByteArray(new File("F://aa//a.pdf"));
        String encodedString = Base64.getEncoder().encodeToString(fileContent);


        //String encodedString="data:image/jpg;base64,";

        byte[] decodedBytes = Base64.getDecoder().decode(encodedString);
        FileUtils.writeByteArrayToFile(new File("F://aa//cc"+Math.random()+".pdf"), decodedBytes);

    }
}
